export class SearchHeaderQHtmlBox{_UrlContent

    Name

    constructor(){this.Name=this.constructor.name;let t="/PageComponents/"+this.Name,n=document.createElement("link");n.setAttribute("rel","stylesheet");n.setAttribute("href",t+"/style.min.css");document.head.append(n);this._UrlContent=t+"/content"}InsertAdjacentHTML(n,t,i){let r='<div id="'+this.Name+'">    <input type="text" placeholder="'+i+'" />    <a>        <img src="'+this._UrlContent+'/search.png" />    <\/a><\/div>';n.insertAdjacentHTML(t,r)}}